  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  faults for the geologic and geomorphic map of the Offshore of Monterey map area,
  California. The vector data file is included in \"Faults_OffshoreMonterey.zip,\"
  which is accessible from http://dx.doi.org/10.5066/F7F47M6T. The shelf north and
  east of the Monterey Bay Peninsula in the Offshore of Monterey map area is cut by
  a diffuse zone of northwest striking, steeply dipping to vertical faults comprising
  the Monterey Bay Fault Zone (MBFZ). This zone, originally mapped by Greene (1977,
  1990), extends about 45 km across Monterey Bay (Map E on sheet 9). Fault strands
  within the MBFZ are mapped with high-resolution seismic-reflection profiles (sheet
  8). Seismic-reflection profiles traversing this diffuse zone in the map area cross
  as many as 5 faults over a width of about 4 to 5 km (see, for example, figs. 3 and
  5 on sheet 8). The zone lacks a continuous \"master fault,\" along which deformation
  is concentrated. Fault length ranges up to about 20 km (based on mapping outside
  this map area), but most strands are only about 2- to 7-km long. Faults in this
  diffuse zone cut through Neogene bedrock and locally appear to minimally disrupt
  overlying inferred Quaternary sediments. The presence of warped reflections along
  some fault strands suggests that fault offsets may be both vertical and strike-slip.
  Specific offshore faults within the zone that are continuous with mapped onshore
  faults include the Navy Fault, Chupines Fault, and Ord Terrace Fault (Clark and
  others, 1997; Wagner and others, 2002). Carmel Canyon, a relatively straight northwest-trending
  arm of the Monterey Canyon system, extends through the southwestern part of the
  Offshore of Monterey map area. Carmel Canyon has three heads (Greene and others,
  2002), two of which extend east and northeast into Carmel Bay within the map area;
  the third head extends southeast along the main canyon trend for about 3 km beyond
  the confluence with the heads in Carmel Bay. Carmel Canyon is aligned with and structurally
  controlled by the San Gregorio fault zone (Greene and others, 1991), an important
  structure in the distributed transform boundary between the North American and Pacific
  plates (see, for example, Dickinson and others, 2005). This Fault Zone is part of
  a regional fault system that is present predominantly in the offshore for about
  400 km, from Point Conception in the south (where it is known as the Hosgri Fault;
  Johnson and Watt, 2012) to Bolinas and Point Reyes in the north (Bruns and others,
  2002; Ryan and others, 2008). The San Gregorio Fault Zone in the map area is part
  of a 90-km-long offshore segment that extends northward from Point Sur (about 24
  km south of the map area), across outer Monterey Bay to Point Au00f1o Nuevo (51
  km north of the map area) (see sheet 9; see also, Weber and Lajoie, 1980; Brabb
  and others, 1998; Wagner and others, 2002). High-resolution seismic-reflection data
  collected across the canyon do not clearly image the San Gregorio Fault Zone, due
  largely to significant depth and steep canyon walls. Accordingly, we have mapped
  the 1,000- 1,300-m-wide fault zone largely on the presence of prominent, lengthy,
  geomorphic lineaments (sheets 1 and 2) and both geomorphic and lithologic contrasts
  across the fault. Faults were primarily mapped by interpretation of seismic reflection
  profile data (see OFR 2013-1071). The seismic reflection profiles were collected
  between 2007 and 2010. References Cited Bruns, T.R., Cooper, A.K., Carlson, P.R.,
  and McCulloch, D.S., 2002, Structure of the submerged San Andreas and San Gregorio
  Fault zones in the Gulf of Farallones as inferred from high-resolution seismic-reflection
  data, in Parsons, T., ed., Crustal structure of the coastal and marine San Francisco
  Bay region, California: U.S. Geological Survey Professional Paper 1658, p. 77u2013117,
  available at http://pubs.usgs.gov/pp/1658/. Brabb, E.E., 1997, Geologic Map of Santa
  Cruz County, California: A digital database, US Geological Survey Open-File Report
  97u2013489, 1:62,500. Clark, J.C., Dupre, W.R., and Rosenberg, L.L., 1997, Geologic
  map of the Monterey and Seaside 7.5u2013minute quadrangles, Monterey County, Californiau2013A
  digital database: U.S. Geological Survey Open-File Report 97-30, 2 sheets, scale
  1:24,000, http://pubs.usgs.gov/of/1997/of97-030/ Dickinson, W.R., Ducea, M., Rosenberg,
  L.I., Greene, H.G., Graham, S.A., Clark, J.C., Weber, G.E., Kidder, S., Ernst, W.G.,
  and Brabb, E.E., 2005, Net dextral slip, Neogene San Gregorio-Hosgri fault zone,
  coastal California: Geologic evidence and tectonic implications: Geological Society
  of America Special Paper 391, 43 p. Greene, H.G., Maher, N.M., and Paull, C.K.,
  2002, Physiography of the Monterey Bay National Marine Sanctuary and implications
  about continental margin development: Marine Geology, v. 181, p. 55u201382. Greene,
  H.G., Clarke, S.H. and Kennedy, M.P., 1991. Tectonic Evolution of Submarine Canyons
  Along the California Continental Margin. From Shoreline to Abyss, in Osborne, R.H.,
  ed., Society for Sedimentary Geology, Special Publication No. 46, p. 231u2013248.
  Greene, H.G., 1990, Regional tectonics and structural evolution of the Monterey
  Bay region, central California, in Garrison, R.E., Greene, H.G., Hicks, K.R., Weber,
  G.E., and Wright, T.L., eds., Geology and tectonics of the central California coastal
  region, San Francisco to Monterey: American Association of Petroleum Geologists,
  Pacific Section, Guidebook GB67, p. 31u201356. Greene, H.G., 1977, Geology of the
  Monterey Bay region: U.S. Geological Survey Open-File Report 77u2013718, 347 p.
  Greene, H.G., 1990, Regional tectonics and structural evolution of the Monterey
  Bay region, central California, in Garrison, R.E., Greene, H.G., Hicks, K.R., Weber,
  G.E., and Wright, T.L., eds., Geology and tectonics of the central California coastal
